angular.module('myownApp').controller("loginController", function ($scope, $window, $routeParams, authService, loginService, imageService, modalService) {

    $scope.is = { loading: false, loadingCheck: false };

    $scope.loginModel = { login: null, password: null };
    $scope.registerModel = { picture: '', firstName: null, lastName: null, login: null, password: null, confirmPassword: null, email: null, birthdate: null, gender: null };
    $scope.forgotModel = { email: null };

    $scope.doLogin = function () {
        $scope.is.loading = true;
        authService.login($scope.loginModel).then(
            function (response) {
                $scope.is.loading = false;
                $window.location.href = "#home";
            },
            function (errorMessage) {
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                .finally(function () { $scope.is.loading = false; });
            });
    };

    $scope.register = function () {
        $scope.is.loading = true;

        if ($scope.registerModel.password != $scope.registerModel.confirmPassword) {
            modalService.showModal({}, { bodyTitle: "As senhas digitadas não coincidem", actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
            .then(function () { $scope.is.loading = false; });
            return;
        }

        loginService.Register(angular.copy($scope.registerModel)).then(
            function (response) {
                modalService.showModal({}, { bodyTitle: response.Message, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                    .finally(function () {
                        $scope.is.loading = false;
                        $window.location.href = "#login";
                    });
            },
            function (errorMessage) {
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                .finally(function () { $scope.is.loading = false; });
            });
    };

    $scope.checkLoginExists = function () {

        if ($scope.registerModel.login != null) {
            $scope.is.loadingCheck = true;
            loginService.CheckLoginExists($scope.registerModel.login).then(
                function (response) {
                    if (response) {
                        $(".loginFields input").addClass("error").removeClass("success");
                    }
                    else {
                        $(".loginFields input").removeClass("error").addClass("success");
                    }
                    $scope.is.loadingCheck = false;
                },
                function (errorMessage) {
                    modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                    .finally(function () { $scope.is.loadingCheck = false; });
                });
        }
    }

    $scope.validateRegister = function () {
        $scope.is.loading = true;
        loginService.ValidateRegister($routeParams.token).then(
            function (response) {
                modalService.showModal({}, { bodyTitle: response.Message, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                    .finally(function () {
                        $window.location.href = "#login";
                        $scope.is.loading = false;
                    });
            },
            function (errorMessage) {
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                .finally(function () { $scope.is.loading = false; });
            });
    };

    $scope.forgotPassword = function () {
        $scope.is.loading = true;
        loginService.ForgotPassword($scope.forgotModel.email).then(
            function (response) {
                modalService.showModal({}, { bodyTitle: response.Message, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                    .finally(function () {
                        $window.location.href = "#login";
                        $scope.is.loading = false;
                    });
            },
            function (errorMessage) {
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                .finally(function () { $scope.is.loading = false; });
            });
    };

    $scope.resetPassword = function () {
        $scope.is.loading = true;
        if ($scope.resetModel.newPassword != $scope.resetModel.confirmNewPassword) {
            modalService.showModal({}, { bodyTitle: "As senhas digitadas não coincidem", actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
            .finally(function () { $scope.is.loading = false; })
            return;
        }

        loginService.ResetPassword($scope.resetModel.newPassword, $routeParams.token).then(
            function (response) {
                modalService.showModal({}, { bodyTitle: response.Message, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                    .finally(function () {
                        $scope.is.loading = false;
                        $window.location.href = "#login";
                    });
            },
            function (errorMessage) {
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true })
                .finally(function () { $scope.is.loading = false; });
            });
    };

    $scope.addAndResizeImage = function (file, base64_object) {

        $scope.registerModel.picture = '';

        var fileSizeExceeded = file.size >= 1000000;

        if (fileSizeExceeded) {
            modalService.showModal({}, { bodyTitle: "O arquivo excedeu o tamanho máximo permitido (1MB).", actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true });
            $("input[type='file']").val("");
            return;
        }
        else {
            imageService.ResizeImage(base64_object.base64, "600", "600").then(
            function (response) {
                // Add resized image to the Picture array
                $scope.registerModel.picture = response;
            },
            function (errorMessage) {
                $scope.registerModel.picture = '';
                modalService.showModal({}, { bodyTitle: errorMessage, actionButtonText: 'Ok', classIcon: "fa fa-exclamation-circle faa-vertical animated", onlyAlert: true });
            });
        }


    };

});
